import React from "react";
//Locales
import { useLocales } from "../../../locales";
// mui
import { Box, Stack, Typography } from "@mui/material";
import "react-circular-progressbar/dist/styles.css";
import { useSelector } from "react-redux";
import * as URLS from "../../../urls";
import LoadingCards from "../../loadingSkeleton/LoadingCards";
// -------------------------------------------------------------

// --------- Style --------
const cardHolderSx = {
  borderRadius: "25px",
  boxShadow: " 2px 2px 10px rgba(0, 0, 0, 0.1)",
  pb: "16px",
  pt: "16px",
  pl: "24px",
  pr: "24px",
  background: "#FFFFFF",
  height: "120px",
};

const nubmerTextSx = {
  color: "#121212",
  fontSize: "12px",
  fontWeight: "500",
};

const titleTextSx = {
  color: "#9DA0A4",
  fontSize: "12px",
  fontWeight: "500",
  lineHeight: "18px",
};

const subTilteSx = {
  fontWeight: 600,
  fontSize: " 9px",
  lineHeight: "14px",
  letterSpacing: "0.0025em",
  color: "#FFCC63",
};

const rateHolderSx = {
  display: "flex",
  alignItems: "center",
  justifyContent: "space-between",
  p: "4px 8px",
  borderRadius: "10px",
  border: "1px solid rgba(103, 103, 103, 0.1)",
  height: "26px",
  width: "57px",
};

const startIconSx = {
  width: "12px",
  height: "12px",
};

const rateSx = {
  fontSize: "12px",
  fontWeight: 500,
  color: "#535353",
};

export default function HighestMealCard() {
  const { translate } = useLocales();

  const { highestRatedMeal, isLoadingHighestRatedMeal } = useSelector(
    (state) => state.employeeFacility
  );
  /*const { highestRatedMeal, isLoadingHighestRatedMeal } = useSelector(
    (state) => state.branches
  );
 */

  // ------------- JSX Code ---------------
  return (
    !isLoadingHighestRatedMeal ?
      <Box sx={{ ...cardHolderSx }}>
        <Typography mb="20px" sx={{ ...titleTextSx }}>
          {translate(`the_highest_rated_meal`)}
        </Typography>

        <Stack direction="row" justifyContent="space-between">
          {highestRatedMeal ?
            <>
              <Stack direction="row">
                <img
                  src={URLS.baseImageURL + `product/${highestRatedMeal?.imageUrl}`}
                  alt=""
                  style={{
                    width: "64px",
                    height: "56px",
                  }}
                />

                <Stack ml="16px">
                  <Typography mb="16px" sx={{ ...subTilteSx }}>
                    {highestRatedMeal?.name}
                  </Typography>
                  <Typography sx={{ ...nubmerTextSx }}>
                    {highestRatedMeal?.price} {highestRatedMeal?.currency}
                  </Typography>
                </Stack>
              </Stack>

              <Box sx={{ ...rateHolderSx }}>
                <img
                  src="/assets/icons/dashboard/ic_star.svg"
                  alt="star"
                  style={{ ...startIconSx }}
                />
                <Typography sx={{ ...rateSx }}> {highestRatedMeal?.rate}</Typography>
              </Box>
            </>
            :
            <>
            </>
          }


        </Stack>
      </Box>
      :
      <LoadingCards />
  );
}
